import React from 'react'
import {Field, reduxForm} from "redux-form";

const Login = (props) => {

    const onSubmit = (inputData) => {
        console.log(inputData)
    }
    return (
        <div>
            <h1>Login</h1>
            <ReduxForm onSubmit={onSubmit}/>
        </div>
    )
}


const LoginForm = (props) => {

    return (
        <form onSubmit={props.handleSubmit}>
            <div>
                login
                <Field name={'login'}  placeholeder='login..' component={'input'} />
            </div>
            <div>
                password
                <Field name={'password'} placeholeder='password..' component={'input'}/>
            </div>
            <div>
                Remember me<Field name={'rememberMe'} type={'checkbox'} component={'input'} />
            </div>
            <div>
                <button>Login</button>
            </div>
        </form>
    )
}

const ReduxForm = reduxForm({
    form: 'login'
})(LoginForm)

export default Login
